        // find the child with 1-ilocos-norte id
        map.childNodes.values().forEach((child) => {
            this.provinces.find((province) => {
                if (child.id === province.key) {
                    child.style.fill = this.calculateColor(province.data);

                    // on hover, lightened the child background
                    child.addEventListener("mouseenter", () => {
                        child.style.fill = "#999999";
                        this.$emit('hovered', province);
                    });

                    // on mouseout, reset the child background
                    child.addEventListener("mouseleave", () => {
